import React, { useState } from 'react';
import { QrReader } from 'react-qr-reader';  // Import QR code scanner
import './V_Dashboard.css';  // Assuming this is your CSS for the page

const V_DashboardPage = () => {
  const [showForm, setShowForm] = useState(false);
  const [qrData, setQrData] = useState(null);  // Store scanned QR code data

  const handleRegisterVehicleClick = () => {
    setShowForm(true);
  };

  const handleCloseForm = () => {
    setShowForm(false);
  };

  const handleScan = (data) => {
    if (data) {
      setQrData(data);  // Set the scanned QR code data
      console.log("Scanned QR code:", data);
    }
  };

  const handleError = (err) => {
    console.error(err);
  };

  return (
    <div className="home-container">
      <div className="home-header">
        <h1>Welcome, Vehicle Owner</h1>
        <p>Manage your vehicles and fuel quotas easily.</p>
      </div>

      {/* User Profile Section */}
      <div className="profile-section">
        <h2>Your Profile</h2>
        <p><strong>Name:</strong> John Doe</p>  {/* Example profile info */}
        <p><strong>Email:</strong> john.doe@example.com</p>
        <p><strong>Registered Vehicles:</strong></p>
        <ul>
          <li>Vehicle 1: ABC-1234 (Petrol)</li>
          <li>Vehicle 2: XYZ-5678 (Diesel)</li>
        </ul>
      </div>

      {/* Action Button */}
      <div className="action-container">
        <button className="register-button" onClick={handleRegisterVehicleClick}>
          Register Vehicle
        </button>
      </div>

      {/* Modal Form for Vehicle Registration */}
      {showForm && (
        <div className={`modal ${showForm ? 'show' : ''}`}>
          <div className="modal-content">
            <h2>Register Your Vehicle</h2>
            <form>
              <label>Vehicle Number</label>
              <input type="text" placeholder="Enter vehicle number" required />

              <label>Vehicle Model</label>
              <input type="text" placeholder="Enter vehicle model" required />

              <label>Engine Capacity (cc)</label>
              <input type="number" placeholder="Enter engine capacity" required />

              <label>Fuel Type</label>
              <select required>
                <option value="">Select Fuel Type</option>
                <option value="Petrol">Petrol</option>
                <option value="Diesel">Diesel</option>
              </select>

              <label>Chassis Number</label>
              <input type="text" placeholder="Enter chassis number" required />

              <div className="form-actions">
                <button type="submit" className="submit-button">Submit</button>
                <button type="button" className="cancel-button" onClick={handleCloseForm}>Cancel</button>
              </div>
            </form>
          </div>
        </div>
      )}

      {/* QR Code Scanner Section */}
      <div className="qr-scanner-section">
        <h2>Scan QR Code for Fuel Quota</h2>
        <QrReader
          onResult={(result, error) => {
            if (!!result) {
              handleScan(result?.text);  // Capture QR code text
            }

            if (!!error) {
              handleError(error);
            }
          }}
          style={{ width: '100%' }}
        />
        {qrData && (
          <div className="qr-result">
            <p>Scanned Data: {qrData}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default V_DashboardPage;
